    function weightedRarityGenerator(uint16 pseudoRandomNumber, uint8 trait)
        private
        view
        returns (uint16)
    {
        uint16 lowerBound = 0;

        for (uint8 i = 0; i < 2; i++) {
            uint16 weight = 5;

            if (
                pseudoRandomNumber >= lowerBound &&
                pseudoRandomNumber < lowerBound + weight
            ) {
                return i;
            }

            lowerBound = lowerBound + weight;
        }

        revert();
    }
